      </Head>
      <h1>
        Your weekly <span>Tech News</span>
      </h1>
      <h2>The Mousepad</h2>

      <Body />

      <style jsx>{`
        h1 {
          font-family: "Apercu Regular";
          font-size: 48px;
          color: #bdbcbc;
        }
        h1 span {
          font-family: "Apercu Medium";
          color: #ffffff;
        }
        h2 {
          font-family: "Apercu Bold";
          font-size: 48px;
          color: #ffdb00;
        }
      `}</style>
    </div>
  );
};

export default Home;
